import React from 'react';

export function Contact() {
    return (
        <>
            <h2>Contact</h2>
            <form>
                <label>
                    Email: <input name="email"></input>
                </label>
                <label>
                    Name: <input name="name"></input>
                </label>
                <label>
                    Message: <textarea rows={10} cols={40} name="message"></textarea>
                </label>
            </form>

            <style jsx>{`
                {/* form {
                    display: flex;
                }     */}
            `}</style>
        </>
    );
}
